import classes from "./Selectors.module.css";

export default function SelectTypeItems({ setType }) {
  return (
    <div className={classes.type}>
      <button onClick={console.log("123")}>Привилегии</button>
      <button onClick={setType("cases")}>Кейсы</button>
      <button onClick={setType("items")}>Предметы</button>
    </div>
  );
}
